export interface AbstractInteraction {
    timestamp?: number;
    interactionType?: InteractionType;
    payload?: AbstractEntry;
    id?: string;
    attachmentIndex?: number;
    contentLength?: number;
    text?: string;
}
export type InteractionType = "EntryInteraction" | "AttachmentInteraction";
export interface AbstractEntry {
    id?: string;
    entryType: EntryType;
    abstractMessage?: AbstractMessage;
}
export type EntryType = "Message" | "MessageDeliveryFailed" | "TypingStartedIndicator" | "TypingStoppedIndicator";
export interface AbstractMessage {
    messageType: MessageType;
    id?: string;
    staticContent?: AbstractStaticContent;
}
export type MessageType = "StaticContentMessage";
export interface AbstractStaticContent {
    formatType: FormatType;
    text?: string;
}
export type FormatType = "Text" | "Attachments";
